[DatabaseSchema]
Name = "BaseProductionV6"
Comment Line0001 = "This schema uses stored procedure statements to log results and supports use with Microsoft SQL Server only. The schema "
Comment Line0002 = "generates unique GUID values for primary key values.\r\n\r\nThe schema handles results as follows:\r\n- Logs UUT Results"
Comment Line0003 = " to the UUT_RESULT table.\r\n- Logs Step Results to the STEP_RESULT table.\r\n- Logs Sequence Call step details to the S"
Comment Line0004 = "TEP_SEQCALL table.\r\n- Logs Property Results to tables as follows:\r\n  - Logs general property information to PROP_RES"
Comment Line0005 = "ULT.\r\n  - Logs string, number, and Boolean values to PROP_RESULT \r\n    as string values.\r\n  - Logs LabVIEWAnalogWa"
Comment Line0006 = "veform, NI_IviWave, and\r\n      NI_IviWavePair to PROP_ANALOGWAVEFORM.\r\n  - Logs LabVIEWDigitalWaveform to PROP_DIGIT"
Comment Line0007 = "ALWAVEFORM.\r\n  - Logs Numeric Limit Test and Multiple Numeric Limit Test results to\r\n      PROP_NUMERICLIMIT.\r\n"
AllowEditing = True
%HI: Statements = [12]

